import React from 'react';
import 'antd/dist/antd.css';
import '../css/Profile.css'
import { Menu , Form, Input, Button, Radio} from 'antd';
import AppHeader from './AppHeader'
import { AppstoreOutlined, MailOutlined, SettingOutlined } from '@ant-design/icons';
const { SubMenu } = Menu;


export default class Profile extends React.Component {
  handleClick = e => {
    console.log('click ', e);
  };


  render() {
    return (
      <div>
        <div>
        <AppHeader/>
        </div>
        <div className="mainProfile">
        <div id="leftProfile">
        <Menu
          onClick={this.handleClick}
          style={{ width: 256 }}
          defaultSelectedKeys={['1']}
          defaultOpenKeys={['sub1']}
          mode="inline"
        >
        <Menu.Item key='1' >Thông tin cơ bản</Menu.Item>
        <Menu.Item key='2' >Đổi mật khẩu</Menu.Item>
        </Menu>
        </div>
        <div id ="rightProfile">
          <form>
            <p>Họ và Tên:</p>
            <input type="text" name="fullName" disabled/>
            <p>Ngày sinh:</p>
            <input type="date" name="birthday" disabled/>
            <p>Email:</p>
            <input type="text" name="email" disabled/>
            <p>Mã số sinh viên:</p>
            <input type="text" name="studentID" disabled/>
            <p>Số điện thoại:</p>
            <input type="text" name="phone" disabled/>
          </form>
        </div>
        </div>
      </div>
    );
  }
}
